import Vue from 'vue'
import App from './App.vue'
import router from './router'
import axios from 'axios'

Vue.config.productionTip = false

// 配置axios
Vue.prototype.$axios = axios.create({
  baseURL: 'http://localhost:8080', // 后端API地址
  timeout: 5000
})

new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
